import Home from './components/HomePage/Home';
import Menu from './components/MenuPage/Menu';

import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom"; 

import './App.css';
function App() {
  return (
    <Router>
    <div className="container"> 
         <Home />
      </div>


      <Switch>
          <Route exact path="/menu">
            <Menu />
          </Route>

        </Switch>

  </Router>
  );
}

export default App;
